/*******************************************************************************
* Function Name: ADC_Mux_Set
********************************************************************************
* Summary:
*  This function is used to set a particular channel as active on the AMux.
*
* Parameters:  
*   channel - The mux channel input to set as active
*
* Return:
*   void
*
*******************************************************************************/
void ADC_Mux_Set(uint8 channel)
{
	uint8 i;
	uint8 channelMask = (1UL << channel);
	if ((channel < 8u) && ((ADC_Mux__armsEnabled & channelMask) == ((uint32)0u)))
	{
		ADC_Mux__armsEnabled |= channelMask;
		*ADC_Mux__outerAddr[channel] |= ADC_Mux__outerMask[channel];
		i = ADC_Mux__innerMap[channel];
		if (ADC_Mux__refCnt[i] == 0u)
		{
			*ADC_Mux__innerAddr[i] |= ADC_Mux__innerMask[i];
		}
		ADC_Mux__refCnt[i]++;
	}
}

/*******************************************************************************
* Function Name: ADC_Mux_Unset
********************************************************************************
* Summary:
*  This function is used to clear a particular channel from being active on the
*  AMux.
*
* Parameters:  
*   channel - The mux channel input to mark inactive
*
* Return:
*   void
*
*******************************************************************************/
void ADC_Mux_Unset(uint8 channel)
{
	uint8 i;
	uint8 channelMask = (1UL << channel);
	if ((channel < 8u) && ((ADC_Mux__armsEnabled & channelMask) != ((uint32)0u)))
	{
		ADC_Mux__armsEnabled &= (uint8)~channelMask;
		*ADC_Mux__outerAddr[channel] &= (uint8)~ADC_Mux__outerMask[channel];
		i = ADC_Mux__innerMap[channel];
		ADC_Mux__refCnt[i]--;
		if (ADC_Mux__refCnt[i] == 0)
		{
			*ADC_Mux__innerAddr[i] &= (uint8)~ADC_Mux__innerMask[i];
		}
	}
}



